import React from "react";

const person = props => {
  return (
    //allows multi lines
    <div>
      <p onClick={props.click}>
        Im {props.name}, Im {props.age}. random number: {Math.random()}
      </p>
      <p>{props.children}</p>
      <input type="text" />
    </div>
  ); //random number: example for inserting one line expression with {}
};

export default person;
